    ms: "Loading...",
    ml: 'സെഷനുകളിലുടനീളം ഡാറ്റ ലിങ്ക് ചെയ്യുന്നതിന് ഒരു അദ്വിതീയ ഐഡി ആവശ്യമാണ്. "**sss**" എന്ന EasyEyes ഐഡി ഉപയോഗിച്ച് ഈ കമ്പ്യൂട്ടർ മുമ്പ് **ddd** എന്ന സെഷനിൽ പങ്കെടുത്തിരുന്നു. അത് നിങ്ങളാണെങ്കിൽ ശരി അമർത്തുക. അല്ലെങ്കിൽ, നിങ്ങൾക്ക് ഒരു EasyEyes ഐഡി ഫയൽ ഉണ്ടെങ്കിൽ, അത് തുറക്കാൻ ചുവടെയുള്ള ഫയൽ തിരഞ്ഞെടുക്കൽ ബട്ടൺ അമർത്തുക. (ഫയലിൻ്റെ പേര് "EasyEyes" ൽ ആരംഭിക്കുന്നു, ".txt" ൽ അവസാനിക്കുന്നു, സാധാരണയായി നിങ്ങളുടെ ഡൗൺലോഡ് ഫോൾഡറിലായിരിക്കും.) നിങ്ങൾക്ക് ഒരു ഫയൽ ഇല്ലെങ്കിലും നിങ്ങളുടെ EasyEyes ഐഡി അറിയാമെങ്കിൽ, അത് ടൈപ്പ് ചെയ്യുക. അല്ലെങ്കിൽ, നിങ്ങളുടെ സ്വന്തം ഐഡി ഉണ്ടാക്കുക, അത് ഏതെങ്കിലും ആൽഫാന്യൂമെറിക് സ്‌ട്രിംഗും (കൂടാതെ "_", ഡാഷ് "-", പിരീഡ് "." എന്നിവ) കുറഞ്ഞത് 5 പ്രതീകങ്ങളെങ്കിലും ദൈർഘ്യമുള്ളതാകാം. നിങ്ങൾക്ക് വേണമെങ്കിൽ അത് നിങ്ങളുടെ പേരായിരിക്കാം. ഞങ്ങൾ ഇത് നിങ്ങൾക്കായി ഈ കമ്പ്യൂട്ടറിൽ ഓർക്കും, എന്നാൽ നിങ്ങൾ മറ്റൊരു കമ്പ്യൂട്ടറിലേക്ക് പോകുകയാണെങ്കിൽ, ദയവായി നിങ്ങളുടെ EasyEyes ഐഡി ഫയൽ എടുക്കുക (നിങ്ങളുടെ ഡൗൺലോഡുകൾ ഫോൾഡറിലെ ഏറ്റവും പുതിയ ഫയൽ), അല്ലെങ്കിൽ കുറഞ്ഞത് നിങ്ങളുടെ EasyEyes ഐഡി എങ്കിലും എഴുതുക. സെഷനിൽ നിന്ന് സെഷനിലേക്ക് നിങ്ങളുടെ ഡാറ്റ ലിങ്ക് ചെയ്യാൻ എല്ലാ സമയത്തും ഇത് ഉപയോഗിക്കുക.',
    no: 'En unik ID er nødvendig for å koble data på tvers av økter. Denne datamaskinen deltok tidligere i en økt på **ddd** med EasyEyes ID "**sss**". Trykk OK hvis det er deg. Ellers, hvis du har en EasyEyes ID-fil, trykk på filvalgknappen nedenfor for å åpne den. (Filnavnet begynner med "EasyEyes", slutter med ".txt", og er vanligvis i mappen Nedlastinger.) Hvis du ikke har en fil, men kjenner din EasyEyes-ID, skriv den inn. Ellers er det bare å lage din egen ID, som kan være en hvilken som helst alfanumerisk streng (pluss understrek "_", bindestrek "-" og punktum ".") minst 5 tegn lang. Det kan være navnet ditt, hvis du vil. Vi vil huske det for deg på denne datamaskinen, men hvis du går til en annen datamaskin, vennligst ta EasyEyes ID-filen (den nyeste filen i nedlastingsmappen), eller i det minste skriv ned EasyEyes ID-en. Bruk den hver gang for å koble dataene dine fra økt til økt.',
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Уникальный идентификатор необходим для связи данных между сеансами. Этот компьютер ранее участвовал в сеансе **ddd** с идентификатором EasyEyes «**sss**». Нажмите ОК, если это вы. В противном случае, если у вас есть файл EasyEyes ID, нажмите кнопку выбора файла ниже, чтобы открыть его. (Имя файла начинается с «EasyEyes», заканчивается на «.txt» и обычно находится в папке «Загрузки».) Если у вас нет файла, но вы знаете свой идентификатор EasyEyes, введите его. В противном случае просто придумайте свой собственный идентификатор, который может представлять собой любую буквенно-цифровую строку (плюс подчеркивание «_», дефис «-» и точку «.») длиной не менее 5 символов. Если хотите, это может быть ваше имя. Мы запомним его на этом компьютере, но если вы перейдете на другой компьютер, возьмите с собой файл идентификатора EasyEyes (самый последний файл в папке «Загрузки») или хотя бы запишите свой идентификатор EasyEyes. Используйте его каждый раз, чтобы связывать свои данные от сеанса к сеансу.",
    sr: "Loading...",
    es: 'Se necesita un ID único para vincular datos entre sesiones. Este ordenador participó previamente en una sesión el **ddd** con el ID de EasyEyes “**sss**”. Presiona OK si eres tú. De lo contrario, si tienes un archivo de ID de EasyEyes, presiona el botón de selección de archivo a continuación para abrirlo. (El nombre del archivo comienza con "EasyEyes", termina con ".txt" y generalmente está en tu carpeta de Descargas). Si no tienes un archivo, pero conoces tu ID de EasyEyes, entonces escríbelo. De lo contrario, simplemente inventa tu propio ID, que puede ser cualquier cadena alfanumérica (más guion bajo "_", guion "-" y punto ".") de al menos 5 caracteres de largo. Puede ser tu nombre, si lo prefieres. Lo recordaremos por ti en este ordenador, pero si vas a otro ordenador, por favor lleva tu archivo de ID de EasyEyes (el archivo más reciente en tu carpeta de Descargas), o al menos anota tu ID de EasyEyes. Úsalo cada vez para vincular tus datos de sesión a sesión.',
