    ar: 'هاتف Android الخاص بك. نحتاج إلى تفاصيل تحدد علامته التجارية وطرازه. انتقل إلى الإعدادات > حول الهاتف (سابقًا "حول الجهاز"). \nبالنسبة لسامسونج جالاكسي: انسخ العنوان الكبير "Galaxy ..." إلى اسم الطراز أدناه، ونسخ رقم الطراز إلى رقم الطراز أدناه. \nبالنسبة لموتو جي: يتم دمج اسم الطراز (والرقم) في سطر واحد يسمى "الطراز". انسخ الاسم (خارج الأقواس) إلى اسم الطراز أدناه. انسخ الرقم داخل الأقواس، والذي قد يتضمن حروفًا وأرقامًا، إلى رقم الطراز أدناه.\nبالنسبة لأي هاتف آخر: انسخ "اسم المنتج" إلى اسم الطراز أدناه. انسخ "اسم الطراز" إلى رقم الطراز أدناه.',
