    "en-US":
      'YOUR iPhone. We need two details specifying the model of your iPhone. On the phone, go to Settings > General > About. \n\n1. MODEL NAME. If it\'s running iOS 12.2 or later, copy the Model Name into the field below. If it\'s running an older iOS, see LAST RESORT below.\n\n2. HIDDEN "A" NUMBER. If you\'re running iOS 10 or later, then tapping the Model Number will reveal the hidden "A" number: an "A" followed by four digits, like A1234. Copy the A number into the field below. \nIf it\'s iPhone 8 or later, with a SIM tray, remove the SIM tray and look for the A number in the slot. If there\'s no SIM tray, look for the A number in the Lightning or USB-C connector. Make sure that you\'re in a place with bright light overhead. The A number is on the upper side — the side with the display. Copy the A number into the field below. \nIf the iPhone is older than the iPhone 8, the A number is printed on the back as something like "Model A1234". Copy the A number into the field below. \n\nLAST RESORT. If you have ChapGPT or equivalent, copy the iPhone\'s Model Number, e.g. MD298HB/A, from its About page and ask ChatGPT for its model name and A number.',
    ar: 'هاتف iPhone الخاص بك. نحتاج إلى تفاصيلين لتحديد طراز iPhone الخاص بك. على الهاتف، انتقل إلى الإعدادات > عام > حول.\n\n1. اسم الطراز. إذا كان يعمل بنظام iOS 12.2 أو أحدث، انسخ اسم الطراز في الحقل أدناه. إذا كان يعمل بنظام iOS أقدم، انظر إلى الخيار الأخير أدناه.\n\n2. الرقم "A" المخفي. إذا كنت تستخدم iOS 10 أو أحدث، فإن النقر على رقم الطراز سيكشف عن الرقم "A" المخفي: حرف "A" متبوع بأربعة أرقام، مثل A1234. انسخ الرقم A في الحقل أدناه. \nإذا كان iPhone 8 أو أحدث، مع درج SIM، قم بإزالة درج SIM وابحث عن الرقم A في الفتحة. إذا لم يكن هناك درج SIM، ابحث عن الرقم A في موصل Lightning أو USB-C. تأكد من أنك في مكان به ضوء ساطع من الأعلى. الرقم A موجود على الجانب العلوي - الجانب الذي يحتوي على الشاشة. انسخ الرقم A في الحقل أدناه. \nإذا كان iPhone أقدم من iPhone 8، فإن الرقم A مطبوع على الخلف كشيء مثل "Model A1234". انسخ الرقم A في الحقل أدناه.\n\nالخيار الأخير. إذا كان لديك ChatGPT أو ما يعادله، انسخ رقم طراز iPhone، مثل MD298HB/A، من صفحة حول واطلب من ChatGPT اسم الطراز ورقم A.',
    hy: "Loading...",
