    "zh-CN":
      "你的 iPhone。我们需要两个详细信息来指定您的 iPhone 型号。在手机上，转至“设置”>“通用”>“关于”。 \n\n1. 型号名称。如果运行的是 iOS 12.2 或更高版本，请将型号名称复制到下面的字段中。如果它运行的是较旧的 iOS，请参阅下面的“最后的解决方案”。\n\n2. 隐藏的“A”号。如果您运行的是 iOS 10 或更高版本，则点击型号将显示隐藏的“A”编号：“A”后跟四位数字，例如 A1234。将 A 号码复制到下面的字段中。 \n如果是 iPhone 8 或更高版本，带有 SIM 托盘，请取出 SIM 托盘并查找插槽中的 A 号码。如果没有 SIM 卡托盘，请查找 Lightning 或 USB-C 连接器中的 A 编号。确保您位于头顶光线明亮的地方。 A 编号位于上侧，即有显示屏的一侧。将 A 号码复制到下面的字段中。 \n如果 iPhone 比 iPhone 8 旧，则背面会印有 A 编号，例如“型号 A1234”。将 A 号码复制到下面的字段中。 \n\n最后的手段。如果您有 ChapGPT 或同等版本，请复制 iPhone 的型号，例如MD298HB/A，从其“关于”页面向 ChatGPT 询问其型号名称和 A 编号。",
