    "en-UK":
      'YOUR iPhone. We need two details specifying the model of your iPhone. On the phone, go to Settings > General > About.\n\n1. MODEL NAME. If it\'s running iOS 12.2 or later, copy the Model Name into the field below. If it\'s running an older iOS, see LAST RESORT below.\n\n2. HIDDEN "A" NUMBER. If you\'re running iOS 10 or later, then tapping the Model Number will reveal the hidden "A" number: an "A" followed by four digits, like A1234. Copy the A number into the field below. If it\'s iPhone 8 or later, with a SIM tray, remove the SIM tray and look for the A number in the slot. If there\'s no SIM tray, look for the A number in the Lightning or USB-C connector. Make sure that you\'re in a place with bright light overhead. The A number is on the upper side — the side with the display. Copy the A number into the field below. If the iPhone is older than the iPhone 8, the A number is printed on the back as something like "Model A1234". Copy the A number into the field below.\n\nLAST RESORT. If you have ChapGPT or equivalent, copy the iPhone\'s Model Number, e.g. MD298HB/A, from its About page and ask ChatGPT for its model name and A number.',
    fi: "Loading...",
    fr: "VOTRE iPhone. Nous avons besoin de deux détails spécifiant le modèle de votre iPhone. Sur le téléphone, allez dans Réglages > Général > Informations.\n\n1. NOM DU MODÈLE. S'il fonctionne sous iOS 12.2 ou une version ultérieure, copiez le nom du modèle dans le champ ci-dessous. S'il fonctionne sous une version antérieure d'iOS, voir DERNIER RECOURS ci-dessous.\n\n2. NUMÉRO \"A\" CACHÉ. Si vous utilisez iOS 10 ou une version ultérieure, appuyer sur le numéro de modèle révélera le numéro \"A\" caché : un \"A\" suivi de quatre chiffres, comme A1234. Copiez le numéro A dans le champ ci-dessous. \nSi c'est un iPhone 8 ou plus récent, avec un tiroir SIM, retirez le tiroir SIM et cherchez le numéro A dans l'emplacement. S'il n'y a pas de tiroir SIM, cherchez le numéro A dans le connecteur Lightning ou USB-C. Assurez-vous d'être dans un endroit bien éclairé. Le numéro A se trouve sur le côté supérieur — le côté avec l'écran. Copiez le numéro A dans le champ ci-dessous. \nSi l'iPhone est plus ancien que l'iPhone 8, le numéro A est imprimé à l'arrière sous la forme \"Modèle A1234\". Copiez le numéro A dans le champ ci-dessous.\n\nDERNIER RECOURS. Si vous avez ChatGPT ou équivalent, copiez le numéro de modèle de l'iPhone, par exemple MD298HB/A, depuis sa page Informations et demandez à ChatGPT son nom de modèle et son numéro A.",
