    id: "Loading...",
    it: 'Il tuo iPhone. Abbiamo bisogno di due dettagli che specifichino il modello del tuo iPhone. Sul telefono, vai su Impostazioni > Generali > Info.\n\n1. NOME MODELLO. Se è in esecuzione iOS 12.2 o successivo, copia il Nome Modello nel campo sottostante. Se è in esecuzione una versione iOS precedente, vedi ULTIMA RISORSA qui sotto.\n\n2. NUMERO "A" NASCOSTO. Se stai utilizzando iOS 10 o successivo, toccando il Numero Modello verrà rivelato il numero "A" nascosto: una "A" seguita da quattro cifre, come A1234. Copia il numero A nel campo sottostante. \nSe è un iPhone 8 o successivo, con un vassoio SIM, rimuovi il vassoio SIM e cerca il numero A nello slot. Se non c\'è un vassoio SIM, cerca il numero A nel connettore Lightning o USB-C. Assicurati di essere in un luogo con luce intensa sopra di te. Il numero A si trova sul lato superiore — il lato con il display. Copia il numero A nel campo sottostante. \nSe l\'iPhone è più vecchio dell\'iPhone 8, il numero A è stampato sul retro come qualcosa tipo "Modello A1234". Copia il numero A nel campo sottostante.\n\nULTIMA RISORSA. Se hai ChatGPT o equivalente, copia il Numero Modello dell\'iPhone, ad esempio MD298HB/A, dalla sua pagina Info e chiedi a ChatGPT il nome del modello e il numero A.',
    ja: "あなたのiPhone。 iPhone のモデルを指定する 2 つの詳細情報が必要です。電話機で、[設定] > [一般] > [バージョン情報] に移動します。 \n\n1. モデル名。 iOS 12.2 以降を実行している場合は、モデル名を下のフィールドにコピーします。古い iOS を実行している場合は、以下の「最後の手段」を参照してください。\n\n2. 隠された「A」番号。 iOS 10 以降を実行している場合は、モデル番号をタップすると、A1234 のように、「A」の後に 4 桁の数字が続く、隠れた「A」番号が表示されます。 A 番号を下のフィールドにコピーします。 \nSIM トレイのある iPhone 8 以降の場合は、SIM トレイを取り外し、スロットの A 番号を探します。 SIM トレイがない場合は、Lightning または USB-C コネクタの A 番号を探してください。頭上に明るい光が当たる場所にいるようにしてください。 A 番号は上側、つまりディスプレイのある側にあります。 A 番号を下のフィールドにコピーします。 \niPhone 8 より古い iPhone の場合、A 番号は「Model A1234」のように背面に印刷されています。 A 番号を下のフィールドにコピーします。 \n\n最後のリゾート。 ChapGPT または同等のものをお持ちの場合は、iPhone のモデル番号をコピーします。 MD298HB/A については、About ページから ChatGPT にモデル名と A 番号を問い合わせてください。",
