    ms: "Loading...",
    ml: 'നിങ്ങളുടെ iPhone. നിങ്ങളുടെ iPhone-ൻ്റെ മോഡൽ വ്യക്തമാക്കുന്ന രണ്ട് വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ഫോണിൽ, ക്രമീകരണങ്ങൾ > പൊതുവായത് > കുറിച്ച് എന്നതിലേക്ക് പോകുക. \n\n1. മോഡലിൻ്റെ പേര്. ഇത് iOS 12.2 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ള പതിപ്പിലാണ് പ്രവർത്തിക്കുന്നതെങ്കിൽ, മോഡലിൻ്റെ പേര് ചുവടെയുള്ള ഫീൽഡിലേക്ക് പകർത്തുക. ഇത് പഴയ iOS ആണ് പ്രവർത്തിപ്പിക്കുന്നതെങ്കിൽ, ചുവടെയുള്ള അവസാന റിസോർട്ട് കാണുക.\n\n2. മറച്ച "എ" നമ്പർ. നിങ്ങൾ iOS 10 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ള പതിപ്പാണ് പ്രവർത്തിപ്പിക്കുന്നതെങ്കിൽ, മോഡൽ നമ്പർ ടാപ്പുചെയ്യുന്നത് മറഞ്ഞിരിക്കുന്ന "A" നമ്പർ വെളിപ്പെടുത്തും: ഒരു "A" എന്നതിന് ശേഷം A1234 പോലെയുള്ള നാല് അക്കങ്ങൾ. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \nഇത് iPhone 8 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ളതാണെങ്കിൽ, ഒരു സിം ട്രേ ഉപയോഗിച്ച്, സിം ട്രേ നീക്കം ചെയ്‌ത് സ്ലോട്ടിലെ A നമ്പർ നോക്കുക. സിം ട്രേ ഇല്ലെങ്കിൽ, മിന്നലിലോ USB-C കണക്ടറിലോ എ നമ്പർ നോക്കുക. നിങ്ങൾ തലക്ക് മുകളിൽ നല്ല വെളിച്ചമുള്ള സ്ഥലത്താണെന്ന് ഉറപ്പാക്കുക. A നമ്പർ മുകൾ വശത്താണ് - ഡിസ്പ്ലേ ഉള്ള വശം. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \nഐഫോൺ ഐഫോൺ 8-നേക്കാൾ പഴയതാണെങ്കിൽ, എ നമ്പർ പുറകിൽ "മോഡൽ എ 1234" പോലെ പ്രിൻ്റ് ചെയ്തിരിക്കും. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \n\nഅവസാന റിസോർട്ട്. നിങ്ങൾക്ക് ChapGPT അല്ലെങ്കിൽ തത്തുല്യമായത് ഉണ്ടെങ്കിൽ, iPhone-ൻ്റെ മോഡൽ നമ്പർ പകർത്തുക, ഉദാ. MD298HB/A, അതിൻ്റെ വിവര പേജിൽ നിന്ന് ചാറ്റ്ജിപിടിയോട് അതിൻ്റെ മോഡലിൻ്റെ പേരും എ നമ്പറും ചോദിക്കുക.',
    no: 'DIN iPhone. Vi trenger to detaljer som spesifiserer modellen til din iPhone. På telefonen går du til Innstillinger > Generelt > Om. \n\n1. MODELLNAVN. Hvis den kjører iOS 12.2 eller nyere, kopierer du modellnavnet til feltet nedenfor. Hvis den kjører en eldre iOS, se SISTE UTVEKSLING nedenfor.\n\n2. SKJULT "A"-NUMMER. Hvis du kjører iOS 10 eller nyere, kan du trykke på modellnummeret for å avsløre det skjulte "A"-nummeret: en "A" etterfulgt av fire sifre, som A1234. Kopier A-tallet inn i feltet nedenfor. \nHvis det er iPhone 8 eller nyere, med SIM-skuff, fjern SIM-skuffen og se etter A-nummeret i sporet. Hvis det ikke er noe SIM-skuff, se etter A-nummeret i Lightning- eller USB-C-kontakten. Sørg for at du er på et sted med sterkt lys over hodet. A-tallet er på oversiden - siden med skjermen. Kopier A-tallet inn i feltet nedenfor. \nHvis iPhone er eldre enn iPhone 8, er A-nummeret trykt på baksiden som noe sånt som "Model A1234". Kopier A-tallet inn i feltet nedenfor. \n\nSISTE UTSTYR. Hvis du har ChapGPT eller tilsvarende, kopier iPhones modellnummer, f.eks. MD298HB/A, fra Om-siden og spør ChatGPT om modellnavnet og A-nummeret.',
    fa: "Loading...",
    pl: "Loading...",
    pt: 'SEU iPhone. Precisamos de dois detalhes especificando o modelo do seu iPhone. No telefone, vá em Ajustes > Geral > Sobre. \n\n1. NOME DO MODELO. Se estiver executando o iOS 12.2 ou posterior, copie o nome do modelo no campo abaixo. Se estiver executando um iOS mais antigo, consulte ÚLTIMO RECURSO abaixo.\n\n2. NÚMERO "A" OCULTO. Se você estiver executando o iOS 10 ou posterior, tocar no número do modelo revelará o número “A” oculto: um “A” seguido de quatro dígitos, como A1234. Copie o número A no campo abaixo. \nSe for iPhone 8 ou posterior, com bandeja do SIM, remova a bandeja do SIM e procure o número A no slot. Se não houver bandeja SIM, procure o número A no conector Lightning ou USB-C. Certifique-se de estar em um local com luz forte no teto. O número A está na parte superior – o lado do display. Copie o número A no campo abaixo. \nSe o iPhone for mais antigo que o iPhone 8, o número A será impresso na parte traseira como algo como “Modelo A1234”. Copie o número A no campo abaixo. \n\nÚLTIMO RECURSO. Se você tiver ChapGPT ou equivalente, copie o número do modelo do iPhone, por exemplo. MD298HB/A, na página Sobre e peça ao ChatGPT o nome do modelo e o número A.',
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'TU iPhone. Necesitamos dos detalles que especifiquen el modelo de tu iPhone. En el teléfono, ve a Configuración > General > Acerca de.\n\n1. NOMBRE DEL MODELO. Si está ejecutando iOS 12.2 o posterior, copia el Nombre del Modelo en el campo de abajo. Si está ejecutando una versión anterior de iOS, consulta ÚLTIMO RECURSO abajo.\n\n2. NÚMERO "A" OCULTO. Si estás ejecutando iOS 10 o posterior, al tocar el Número de Modelo se revelará el número "A" oculto: una "A" seguida de cuatro dígitos, como A1234. Copia el número A en el campo de abajo. \nSi es un iPhone 8 o posterior, con una bandeja SIM, retira la bandeja SIM y busca el número A en la ranura. Si no hay bandeja SIM, busca el número A en el conector Lightning o USB-C. Asegúrate de estar en un lugar con luz brillante sobre tu cabeza. El número A está en el lado superior, el lado con la pantalla. Copia el número A en el campo de abajo. \nSi el iPhone es anterior al iPhone 8, el número A está impreso en la parte trasera como algo así: "Modelo A1234". Copia el número A en el campo de abajo.\n\nÚLTIMO RECURSO. Si tienes ChatGPT o equivalente, copia el Número de Modelo del iPhone, por ejemplo, MD298HB/A, de su página Acerca de y pregunta a ChatGPT por su nombre de modelo y número A.',
