    ml: 'DYMO ലേബൽ പ്രിൻ്റർ ഇൻസ്റ്റലേഷൻ ഗൈഡ്\nനിങ്ങളുടെ DYMO LabelWriter 550-ൽ ലേബലുകൾ അച്ചടിക്കാൻ ഈ പഠനത്തെ സഹായിക്കുന്നതിന് ഈ ഘട്ടങ്ങൾ പാലിക്കുക.\n① DYMO സോഫ്റ്റ്‌വെയർ ഇൻസ്റ്റാൾ ചെയ്യുക\nDYMO പിന്തുണാ വെബ്‌സൈറ്റിൽ നിന്ന് നിങ്ങളുടെ OS-നായി ഏറ്റവും പുതിയ DYMO സോഫ്റ്റ്‌വെയർ ഡൗൺലോഡ് ചെയ്‌ത് ഇൻസ്റ്റാൾ ചെയ്യുക:\nhttps://www.dymo.com/support?cfid=user-guide\nനിങ്ങളുടെ ബ്രൗസറിൽ, ഇതിലേക്ക് പോകുക:\nDYMO.WebApi.Mac.Host:\nDYMO.WebApi.Mac.Host പ്രവർത്തിക്കുന്നുവെന്ന് ഉറപ്പാക്കുക.\n② നിങ്ങളുടെ ബ്രൗസർ കോൺഫിഗർ ചെയ്യുക\n▶ Chrome\nഇതിലേക്ക് പോകുക:\nchrome://flags\nതിരയൽ ബാറിൽ TLS-നായി തിരയുക.\nTLS ഫലങ്ങളിൽ നിന്ന്, പ്രവർത്തനരഹിതമാക്കുക:\n⚬ TLS 1.3 ആദ്യകാല ഡാറ്റ\n⚬ TLS 1.3 പോസ്റ്റ് ക്വാണ്ടം കീ കരാർ\n⚬ TLS 1.3-ൽ ML-KEM ഉപയോഗിക്കുക\n⚬ ക്രെഡൻഷ്യൽ മോഡ് അനുവദിക്കുന്നില്ലെങ്കിൽ TLS ക്ലയൻ്റ് സർട്ടിഫിക്കറ്റുകൾ ഒഴിവാക്കുക.\nചുവടെയുള്ള RELAUNCH ക്ലിക്ക് ചെയ്യുക.\n▶ ഫയർഫോക്സ്\nക്രമീകരണങ്ങളിലേക്ക് പോകുക → സർട്ടിഫിക്കറ്റിനായി തിരയുക.\n"മൂന്നാം കക്ഷി റൂട്ട് സർട്ടിഫിക്കറ്റുകൾ സ്വയമേവ വിശ്വസിക്കാൻ Firefox-നെ അനുവദിക്കുക..." എന്നതിൽ അൺചെക്ക് ചെയ്യുക.\nഫയർഫോക്സ് പുനരാരംഭിക്കുക.\n▶ സഫാരി\nഇതിലേക്ക് പോകുക:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nആവശ്യപ്പെടുകയാണെങ്കിൽ, തിരഞ്ഞെടുക്കുക\n“വിശദാംശങ്ങൾ കാണിക്കുക” → “ഈ വെബ്സൈറ്റ് സന്ദർശിക്കുക”\nസുരക്ഷാ മുന്നറിയിപ്പ് മറികടക്കാൻ.\n③ ഒരു ലേബൽ പ്രിൻ്റ് ചെയ്യുക\nDYMO.WebApi.Mac.Host പ്രവർത്തിക്കുന്നുവെന്ന് ഉറപ്പാക്കുക.\nഈ പേജിലെ PRINT LABEL ബട്ടൺ അമർത്തുക.\n\nപ്രശ്നം: നിങ്ങൾക്ക് ഇപ്പോഴും പ്രിൻ്റ് ചെയ്യാൻ കഴിയുന്നില്ലെങ്കിൽ, DYMO.WebApi.Mac.Host പ്രവർത്തിക്കുന്നുണ്ടോയെന്ന് സ്ഥിരീകരിക്കുക അല്ലെങ്കിൽ ഔദ്യോഗിക DYMO പിന്തുണ പരിശോധിക്കുക.\nശ്രദ്ധിക്കുക: നിങ്ങളുടെ ബ്രൗസറിൽ ഉയർന്ന സംരക്ഷണം നിലനിർത്താൻ പ്രിൻ്റ് ചെയ്തതിന് ശേഷം ഏതെങ്കിലും സുരക്ഷാ ക്രമീകരണങ്ങൾ വീണ്ടും പ്രവർത്തനക്ഷമമാക്കുക.',
    no: 'INSTALLASJONSVEILEDNING FOR DYMO ETIKETTESKRIVER\nFølg disse trinnene for å hjelpe denne studien med å skrive ut etiketter på DYMO LabelWriter 550.\n① Installer DYMO-programvaren\nLast ned og installer den nyeste DYMO-programvaren for operativsystemet ditt fra DYMOs støttenettsted:\nhttps://www.dymo.com/support?cfid=user-guide\nI nettleseren din går du til:\nDYMO.WebApi.Mac.Host:\nKontroller at DYMO.WebApi.Mac.Host kjører.\n② Konfigurer nettleseren din\n▶ Chrome\nGå til:\nchrome://flags\nSøk etter TLS i søkefeltet.\nFra TLS-resultatene, deaktiver:\n⚬ TLS 1.3 Tidlige data\n⚬ TLS 1.3 post-kvantenøkkelavtale\n⚬ Bruk ML-KEM i TLS 1.3\n⚬ Utelat TLS-klientsertifikater hvis legitimasjonsmodus ikke tillater det.\nKlikk på RELAUNCH nederst.\n▶ Firefox\nGå til Innstillinger → Søk etter sertifikat.\nFjern merket for "Tillat Firefox å automatisk stole på tredjeparts rotsertifikater ..."\nStart Firefox på nytt.\n▶ Safari\nGå til:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nVelg hvis du blir bedt om det\n"Vis detaljer" → "besøk denne nettsiden"\nfor å omgå sikkerhetsadvarselen.\n③ Skriv ut en etikett\nKontroller at DYMO.WebApi.Mac.Host kjører.\nTrykk på PRINT LABEL-knappen på denne siden.\n\nPROBLEM: Hvis du fortsatt ikke kan skrive ut, bekrefter du at DYMO.WebApi.Mac.Host kjører eller konsulterer offisiell DYMO-støtte.\nFORSIKTIG: Aktiver eventuelle sikkerhetsinnstillinger på nytt etter utskrift for å opprettholde den høyeste beskyttelsen på nettleseren din.',
