    ar: "1. يحتوي هذا الكمبيوتر على 111 كاميرا.\n2. تتبع هذه الدراسة النظرة أو مسافة المشاهدة، ولذا تحتاج إلى كاميرا في الحافة العلوية للشاشة، لذا يرجى اختيار شاشة تحتوي على كاميرا في الحافة العلوية.\n3. يرجى سحب هذه النافذة إلى أي شاشة ترغب في استخدامها لهذه الدراسة.\n4. يكفي أن تكون معظمها على تلك الشاشة.\n5. ثم انقر على متابعة أو اضغط على إدخال.",
