    "en-UK":
      "1. Close your LEFT eye. (This is the left side of the screen.)\n2. Use ▶ arrow key to slide the flickering dot. While looking at the cross, monitor the flickering dot in the corner of your eye, and slide it right and left until it disappears into your blind spot.\n3. Hit the SPACE bar.\nNOTE: Keep your eye on the cross. The flickering dot won't disappear while your eye follows it.",
    fi: "Loading...",
    fr: "1. Fermez votre œil GAUCHE. (C'est le côté gauche de l'écran.)\n2. Utilisez la touche flèche ▶ pour faire glisser le point clignotant. Tout en regardant la croix, surveillez le point clignotant du coin de l'œil et faites-le glisser de droite à gauche jusqu'à ce qu'il disparaisse dans votre point aveugle.\n3. Appuyez sur la barre d'ESPACE.\nREMARQUE : Gardez votre œil sur la croix. Le point clignotant ne disparaîtra pas tant que votre œil le suit.",
