    it: "1. Chiudi l'occhio SINISTRO. (Questo è il lato sinistro dello schermo.)\n2. Usa il tasto freccia ▶ per spostare il punto lampeggiante. Mentre guardi la croce, monitora il punto lampeggiante con la coda dell'occhio e spostalo a destra e a sinistra finché non scompare nel tuo punto cieco.\n3. Premi la barra SPAZIATRICE.\nNOTA: Tieni l'occhio sulla croce. Il punto lampeggiante non scomparirà mentre il tuo occhio lo segue.",
