    sr: "Loading...",
    es: "1. Cierra tu ojo IZQUIERDO. (Este es el lado izquierdo de la pantalla.)\n2. Usa la tecla de flecha ▶ para deslizar el punto parpadeante. Mientras miras la cruz, observa el punto parpadeante en el rabillo del ojo y deslízalo hacia la derecha e izquierda hasta que desaparezca en tu punto ciego.\n3. Presiona la barra ESPACIADORA.\nNOTA: Mantén tu ojo en la cruz. El punto parpadeante no desaparecerá mientras tu ojo lo siga.",
    sw: "1. Funga jicho lako la KUSHOTO. (Huu ni upande wa kushoto wa skrini.)\n2. Tumia ▶ kitufe cha mshale kutelezesha kitone kinachopeperusha. Unapoutazama msalaba, fuatilia kitone kinachopepea kwenye kona ya jicho lako, na telezesha kulia na kushoto hadi kipotee kwenye sehemu yako ya upofu.\n3. Piga upau wa SPACE.\nKUMBUKA: Weka macho yako msalabani. Nukta inayopepea haitatoweka jicho lako likiifuata.",
    sv: "1. Stäng ditt VÄNSTER öga. (Detta är den vänstra sidan av skärmen.)\n2. Använd piltangenten ▶ för att skjuta den flimrande punkten. Medan du tittar på korset, övervaka den flimrande punkten i ögonvrån och skjut den åt höger och vänster tills den försvinner i din döda vinkel.\n3. Tryck på MELLANSLAG.\nOBS: Håll ögonen på korset. Den flimrande punkten försvinner inte medan ditt öga följer den.",
