    ml: "1. നിങ്ങളുടെ വലത് കണ്ണ് അടയ്ക്കുക. (ഇത് സ്ക്രീനിൻ്റെ വലതുഭാഗമാണ്.)\n2. മിന്നുന്ന ഡോട്ട് സ്ലൈഡ് ചെയ്യാൻ അമ്പടയാള കീ ◀ ഉപയോഗിക്കുക. കുരിശിലേക്ക് നോക്കുമ്പോൾ, നിങ്ങളുടെ കണ്ണിൻ്റെ കോണിലുള്ള മിന്നുന്ന ഡോട്ട് നിരീക്ഷിക്കുക, അത് നിങ്ങളുടെ ബ്ലൈൻഡ്‌സ്‌പോട്ടിലേക്ക് അപ്രത്യക്ഷമാകുന്നതുവരെ ഇടത്തോട്ടും വലത്തോട്ടും സ്ലൈഡ് ചെയ്യുക.\n3. SPACE ബാറിൽ അമർത്തുക.\nശ്രദ്ധിക്കുക: നിങ്ങളുടെ കണ്ണ് കുരിശിൽ വയ്ക്കുക. നിങ്ങളുടെ കണ്ണ് അതിനെ പിന്തുടരുമ്പോൾ മിന്നുന്ന ഡോട്ട് അപ്രത്യക്ഷമാകില്ല.",
    no: "1. Lukk HØYRE øye. (Dette er høyre side av skjermen.)\n2. Bruk piltasten ◀ for å skyve den flimrende prikken. Mens du ser på korset, overvåk den flimrende prikken i øyekroken, og skyv den til venstre og høyre til den forsvinner inn i blindsonen.\n3. Trykk på MELLOMROM.\nMERK: Hold øye med korset. Den flimrende prikken forsvinner ikke mens øyet følger den.",
