    ru: "1. С помощью линейки или рулетки измерьте расстояние от центра экрана до передней части одного из глаз (любой глаз в порядке). Если вы носите очки, не обращайте на них внимания во время измерения.\n2. Наклонитесь вперед или назад или переместите стул или экран до тех пор, пока расстояние не составит 111 ААА. Требуемое расстояние всегда отображается в большом размере в правой части экрана и читается с любого расстояния.\n3. ЕСЛИ ЭТО СЛИШКОМ ДАЛЕКО, ПРОПУСТИТЕ ЭТО. Если вы не можете уйти так далеко, пропустите этот шаг, набрав ❌ на клавиатуре или X на клавиатуре.\n4. Как только вы окажетесь на нужном расстоянии, держите голову ровно и отложите линейку в сторону, чтобы камера могла беспрепятственно видеть все ваше лицо.\n5. Нажмите или коснитесь RETURN на клавиатуре или клавиатуре экрана телефона, чтобы продолжить. \n6. Счетчик прогресса ниже сдвинется вправо, и появится следующее расстояние. Перейдите к шагу 1 выше. Для каждой дистанции одни и те же инструкции, меняется только дистанция.\nПРИМЕЧАНИЕ. Если клавиатура телефона перестанет отвечать на запросы, обновите ее, коснувшись адресной строки телефона и нажав «Перейти».",
    sr: "Loading...",
    es: '1. Usa una regla o cinta métrica para medir la distancia desde el centro de tu pantalla hasta el frente de uno de tus ojos (cualquiera de los dos está bien). Si usas gafas, ignóralas mientras mides. \n2. Inclínate hacia adelante o hacia atrás, o mueve tu silla o esta pantalla, hasta que la distancia sea 111 AAA. La distancia requerida siempre se muestra grande en el lado derecho de esta pantalla, legible desde cualquier distancia. \n3. SI ESTÁ DEMASIADO LEJOS, SÁLTALO. Si no puedes alejarte tanto, entonces omite este paso escribiendo ❌ en el teclado numérico o X en el teclado. \n4. Una vez que estés a la distancia correcta, mantén la cabeza firme y deja la regla a un lado para asegurar que la cámara tenga una vista despejada de toda tu cara. \n5. Presiona o toca RETURN en el teclado de tu computadora o en el teclado de la pantalla del teléfono para continuar. \n6. El contador de progreso abajo se deslizará hacia la derecha, y aparecerá la siguiente distancia. Ve al paso 1, arriba. Cada distancia tiene las mismas instrucciones, solo cambia la distancia. \nNOTA: Si el teclado del teléfono alguna vez se vuelve no respondedor, actualízalo tocando la barra de direcciones del teléfono y tocando "ir".',
