    ml: 'ടെസ്റ്റ് ഫോൺ ഇൻ്റർനെറ്റുമായി ബന്ധിപ്പിച്ചിട്ടുണ്ടോ?\n1. അതെ, തുടർന്ന് തുടരുന്നതിന് ചുവടെയുള്ള ശരി ക്ലിക്കുചെയ്യുക.\n2. 📶 സെൽ സേവനം: ഫോണിൻ്റെ സെൽ സേവനം ഇൻ്റർനെറ്റിലേക്ക് കണക്റ്റുചെയ്യുകയാണെങ്കിൽ, ശരി ക്ലിക്കുചെയ്യുക.\n3. 🛜 വൈഫൈ: Wi-Fi വഴി ഇത് ഇൻ്റർനെറ്റിലേക്ക് കണക്റ്റുചെയ്‌ത് ശരി ക്ലിക്കുചെയ്യുക.\n4. സമയവും തീയതിയും സജ്ജീകരിക്കുക: ഒരു പുതിയ ഫോണിന് അല്ലെങ്കിൽ റീസെറ്റ് ചെയ്‌ത പഴയ ഫോണിന് സെൽ സേവന അക്കൗണ്ടും തെറ്റായ തീയതിയും ഇല്ല. നിങ്ങൾ സമയവും തീയതിയും സജ്ജീകരിച്ചുകഴിഞ്ഞാൽ, അടുത്തതായി വിശദീകരിക്കുന്നതുപോലെ, അത് ഹോട്ട്‌സ്‌പോട്ട്/ടെതറിംഗ് ഉപയോഗിച്ച് പ്രവർത്തിക്കും.\n5. ഹോട്ട്‌സ്‌പോട്ട്: ടെസ്റ്റ് ഫോൺ നിങ്ങളുടെ സ്വകാര്യ ഫോണല്ലെങ്കിൽ, നിങ്ങളുടെ സ്വകാര്യ ഫോണിൽ ഇൻ്റർനെറ്റ് ഉണ്ടെങ്കിൽ, രണ്ട് ഫോണുകൾക്കും ഇൻ്റർനെറ്റ് ആക്‌സസ് പങ്കിടാനാകും. Wi-Fi, ബ്ലൂടൂത്ത് അല്ലെങ്കിൽ USB വഴി ഫോണുകൾ പരസ്പരം ബന്ധിപ്പിക്കുക:\n    * 🛜 Wi-Fi ഹോട്ട്‌സ്‌പോട്ട്: സെൽ സേവനം വഴി നിങ്ങളുടെ സ്വകാര്യ ഫോൺ ഇൻ്റർനെറ്റുമായി കണക്‌റ്റ് ചെയ്‌തിട്ടുണ്ടെങ്കിൽ, ടെസ്റ്റ് ഫോണിലേക്ക് അതിന് ഒരു Wi-Fi ഹോട്ട്‌സ്‌പോട്ട് നൽകാനാകും. കണക്റ്റുചെയ്തുകഴിഞ്ഞാൽ, ശരി ക്ലിക്കുചെയ്യുക.\n    * >ᛒ ബ്ലൂടൂത്ത് ടെതറിംഗ്: നിങ്ങളുടെ സ്വകാര്യ ഫോൺ ഇൻ്റർനെറ്റ് ആക്‌സസിനായി Wi-Fi ഉപയോഗിക്കുന്നുണ്ടെങ്കിൽ, അതിന് ബ്ലൂടൂത്ത് വഴി ഇൻ്റർനെറ്റ് ആക്‌സസ് പങ്കിടാനാകും. രണ്ട് ഫോണുകളിലും ബ്ലൂടൂത്ത് (ഐഫോണിൽ) അല്ലെങ്കിൽ ബ്ലൂടൂത്ത് ടെതറിംഗ് (ആൻഡ്രോയിഡിൽ) പ്രവർത്തനക്ഷമമാക്കുക, ബ്ലൂടൂത്ത് വഴി ജോടിയാക്കുക, ശരി ക്ലിക്കുചെയ്യുക.\n    * USB ടെതറിംഗ്: രണ്ട് ഫോണുകളും ഐഫോണുകളോ രണ്ട് ഫോണുകളും ആൻഡ്രോയിഡുകളോ ആണെങ്കിൽ, നിങ്ങൾക്ക് ശരിയായ കേബിൾ ഉണ്ടെങ്കിൽ അവർക്ക് USB കേബിൾ വഴി ഇൻ്റർനെറ്റ് ആക്സസ് പങ്കിടാനാകും. ഇന്ന്, മിക്ക ഫോണുകളും യുഎസ്ബി-സി കണക്റ്റർ ഉപയോഗിക്കുന്നു, എന്നാൽ ഐഫോൺ 14 ഉം അതിനുമുമ്പും മിന്നൽ കണക്റ്റർ ഉപയോഗിക്കുന്നു. ഉചിതമായ കേബിൾ വഴി ഫോണുകൾ ബന്ധിപ്പിച്ച് ശരി ക്ലിക്കുചെയ്യുക.\n6. ഇൻ്റർനെറ്റ് ഇല്ല: ഈ ഓപ്ഷനുകളൊന്നും ലഭ്യമല്ലെങ്കിൽ, ആദ്യം ശരി ക്ലിക്കുചെയ്യുക, തുടർന്ന് "കണക്ട് ചെയ്യാൻ കഴിയില്ല".',
    no: 'ER TESTTELEFONEN KOBLET TIL INTERNETT?\n1. JA, klikk deretter OK nedenfor for å fortsette.\n2. 📶 CELLE SERVICE: Hvis telefonens mobiltjeneste kobles til internett, klikker du OK.\n3. 🛜 WIFI: Koble den til internett via Wi-Fi og klikk OK.\n4. STILL TID OG DATO: En ny telefon, eller en gammel telefon som er tilbakestilt, har ingen mobiltjenestekonto og feil dato. Når du har angitt klokkeslett og dato, vil det fungere med hotspot/tethering, som forklart neste.\n5. HOTSPOT: Hvis testtelefonen ikke er din personlige telefon, og din personlige telefon har internett, kan de to telefonene dele internettilgang. Koble telefonene til hverandre via Wi-Fi, Bluetooth eller USB:\n    * 🛜 Wi-Fi-hotspot: Hvis din personlige telefon er koblet til internett via mobiltjeneste, kan den gi en Wi-Fi-hotspot til testtelefonen. Når du er koblet til, klikker du OK.\n    * >ᛒ Bluetooth-tilknytning: Hvis din personlige telefon bruker Wi-Fi for internettilgang, kan den dele internettilgangen via Bluetooth. Aktiver Bluetooth (på iPhone) eller Bluetooth-tilknytning (på Android) på begge telefonene, par dem via Bluetooth, og klikk OK.\n    * USB-tilknytning: Hvis begge telefonene er iPhones eller begge telefonene er Androider, kan de dele internettilgangen via en USB-kabel, hvis du har riktig kabel. I dag bruker de fleste telefoner en USB-C-kontakt, men iPhone 14 og tidligere bruker Lightning-kontakten. Koble telefonene via riktig kabel og klikk OK.\n6. INGEN INTERNETT: Hvis ingen av disse alternativene er tilgjengelige, klikker du først OK og deretter "Kan ikke koble til".',
