    pl: "Loading...",
    pt: "O TELEFONE DE TESTE ESTÁ CONECTADO À INTERNET?\n1. SIM e clique em OK abaixo para continuar.\n2. 📶 SERVIÇO CELULAR: Se o serviço celular do telefone se conectar à internet, clique em OK.\n3. 🛜 WIFI: Conecte-o à internet via Wi-Fi e clique em OK.\n4. DEFINIR HORA E DATA: Um telefone novo ou antigo que foi reiniciado não tem conta de serviço de celular e está com a data errada. Depois de definir a hora e a data, funcionará com hotspot/tethering, conforme explicado a seguir.\n5. HOTSPOT: Se o telefone de teste não for seu telefone pessoal e seu telefone pessoal tiver internet, os dois telefones poderão compartilhar o acesso à internet. Conecte os telefones entre si por Wi-Fi, Bluetooth ou USB:\n    * 🛜 Ponto de acesso Wi-Fi: Se o seu telefone pessoal estiver conectado à Internet via serviço de celular, ele poderá fornecer um ponto de acesso Wi-Fi para o telefone de teste. Uma vez conectado, clique em OK.\n    * >ᛒ Bluetooth Tethering: Se o seu telefone pessoal estiver usando Wi-Fi para acesso à Internet, ele poderá compartilhar o acesso à Internet via Bluetooth. Habilite o Bluetooth (no iPhone) ou o tethering Bluetooth (no Android) em ambos os telefones, emparelhe-os via Bluetooth e clique em OK.\n    * Tethering USB: Se ambos os telefones forem iPhones ou Androids, eles poderão compartilhar o acesso à Internet por meio de um cabo USB, se você tiver o cabo correto. Hoje, a maioria dos telefones usa um conector USB-C, mas o iPhone 14 e versões anteriores usam o conector Lightning. Conecte os telefones por meio do cabo apropriado e clique em OK.\n6. SEM INTERNET: Se nenhuma dessas opções estiver disponível, primeiro clique em OK e depois em “Não é possível conectar”.",
