    es: "3. CONFIGURAR MICRÓFONO.  \n a. Extiende las tres patas del trípode tanto como sea posible.  \n b. El clip del micrófono del trípode está en un pivote. Gira el clip completamente hacia el lado que haga que el borde más alto del clip sea más alto.  \n c. Inserta el micrófono en el clip del trípode, desde abajo, hasta que el extremo inferior del micrófono esté al ras con el borde más bajo del clip.  \n d. Ajusta la inclinación para que el micrófono esté vertical, apuntando hacia el techo.  \n e. Coloca el trípode en la mesa entre tú y tu computadora. Gira el trípode para llevar el micrófono a tu lado.  \n f. Empuja el trípode hacia tu computadora (o lo que tenga los altavoces) hasta que las dos patas más alejadas del trípode casi lo toquen, y la tercera pata esté cerca de ti.  \n4. Aparecerá un botón de PROCEDER abajo. Haz clic en él para comenzar a calibrar.",
