    id: 'showMeasuredSoundLevelBool bernilai TRUE dalam satu atau beberapa kondisi, sehingga diperlukan mikrofon untuk melakukan pengukuran tersebut.\n1. HUBUNGKAN mikrofon miniDSP UMIK-1 atau 2 Anda ke komputer ini.\n2. PILIH mikrofon tersebut pada pop-up input suara di bawah.\n3. PILIH nama model mikrofon, UMIK-1 atau 2.\n4. Masukkan nomor SERI, dan klik tombol FETCH PROFILE.\n5. SIAPKAN MIKROFON\n A. Rentangkan ketiga kaki tripod sejauh mungkin. \n B. Klip mikrofon tripod dapat diputar. Putar klip sepenuhnya ke sisi mana pun yang membuat tepi tertinggi klip menjadi lebih tinggi. \n C. Masukkan mikrofon ke dalam klip tripod, dari bawah, hingga ujung bawah mikrofon sejajar dengan tepi terendah klip. \n D. Sesuaikan kemiringan untuk membuat mikrofon vertikal, mengarah ke langit-langit. \n e. Tempatkan tripod di atas meja antara Anda dan komputer. Putar tripod untuk mendekatkan mikrofon ke sisi Anda. \n F. Dorong tripod ke arah komputer Anda (atau apa pun yang memiliki speaker) hingga kedua kaki tripod hampir menyentuhnya, dan kaki ketiga berada di dekat Anda.\n6. IZINKAN PENGGUNAAN MIKROFON. Jika muncul pop up yang meminta izin untuk menggunakan mikrofon, klik "Izinkan".\n7. ⇧🔊 VOLUME MAKS. Untuk pengukuran suara yang akurat, maksimalkan volume suara komputer Anda sekarang, lalu jangan sentuh volume tersebut hingga sesi berakhir.\n8. Klik PROCEED atau tekan RETURN.',
