    nl: "Loading...",
    "en-UK":
      "We'll measure the distance between your eyes. Use the video image to watch your eyes. Hold a pen horizontally against your face in front of your eyes. Align your right and left thumb nails with the centres of your right and left pupils. Then bring the pen to the on-screen ruler to measure the separation between your thumbs. Align your left thumb with zero and notice where your right thumb is. Put down the pen and click the ruler at that point. Finally, click OK to continue.",
    fi: "Mittaamme silmiesi välisen etäisyyden. Käytä videokuvaa katsellaksesi silmiäsi. Pidä kynää vaakatasossa kasvojasi vasten silmiesi edessä. Kohdista oikean ja vasemman peukalon kynnesi oikean ja vasemman pupillisi keskikohtiin. Tuo sitten kynä näytön viivaimen luo mitataksesi peukalojesi välinen etäisyys. Kohdista vasen peukalosi nollaan ja huomaa, missä oikea peukalosi on. Aseta kynä alas ja napsauta viivainta siinä kohdassa. Jatka lopuksi napsauttamalla OK.",
    fr: "Nous mesurerons la distance entre vos yeux. Utilisez l'image vidéo pour observer vos yeux. Tenez un stylo horizontalement contre votre visage devant vos yeux. Alignez vos ongles de pouce droit et gauche avec le centre de vos pupilles droite et gauche. Ensuite, amenez le stylo à la règle à l'écran pour mesurer la séparation entre vos pouces. Alignez votre pouce gauche avec zéro et notez où se trouve votre pouce droit. Posez le stylo et cliquez sur la règle à cet endroit. Enfin, cliquez sur OK pour continuer.",
    de: "Wir messen den Abstand zwischen Ihren Augen. Benutzen Sie das Videobild, um Ihre Augen zu beobachten. Halten Sie einen Stift horizontal vor Ihr Gesicht und vor Ihre Augen. Richten Sie Ihren rechten und linken Daumennagel an den Mittelpunkten Ihrer rechten und linken Pupille aus. Halten Sie dann den Stift an das Bildschirmlineal, um den Abstand zwischen Ihren Daumen zu messen. Richten Sie Ihren linken Daumen auf Null aus und achten Sie darauf, wo sich Ihr rechter Daumen befindet. Legen Sie den Stift ab und klicken Sie an dieser Stelle mit dem Lineal. Klicken Sie abschließend auf OK, um fortzufahren.",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Við mælum fjarlægðina á milli augna þinna. Notaðu myndbandsmyndina til að horfa á augun þín. Haltu penna láréttum að andliti þínu fyrir framan augun. Stilltu hægri og vinstri þumalfingursnöglum þínum við miðju hægri og vinstri sjáaldranna. Komdu síðan með pennann að reglustikunni á skjánum til að mæla bilið á milli þumalfingranna. Stilltu vinstri þumalfingri við núll og taktu eftir hvar hægri þumalfingur þinn er. Leggðu frá þér pennann og smelltu á reglustikuna á þeim tímapunkti. Að lokum, smelltu á OK til að halda áfram.",
    id: "Loading...",
    it: "Misureremo la distanza tra i tuoi occhi. Usa l'immagine video per osservare i tuoi occhi. Tieni una penna orizzontalmente contro il tuo viso davanti ai tuoi occhi. Allinea le unghie dei pollici destro e sinistro con i centri delle tue pupille destra e sinistra. Poi porta la penna al righello sullo schermo per misurare la separazione tra i tuoi pollici. Allinea il pollice sinistro con lo zero e nota dove si trova il pollice destro. Metti giù la penna e clicca sul righello a quel punto. Infine, clicca su OK per continuare.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "Loading...",
