    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Loading...",
    pt: "Loading...",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Mediremos la distancia entre tus ojos. Usa la imagen de video para observar tus ojos. Sostén un bolígrafo horizontalmente contra tu cara frente a tus ojos. Alinea las uñas de tus pulgares derecho e izquierdo con los centros de tus pupilas derecha e izquierda. Luego lleva el bolígrafo a la regla en pantalla para medir la separación entre tus pulgares. Alinea tu pulgar izquierdo con el cero y observa dónde está tu pulgar derecho. Deja el bolígrafo y haz clic en la regla en ese punto. Finalmente, haz clic en OK para continuar.",
    sw: "Loading...",
