    tr: "Gözlerinizin arasındaki mesafeyi ölçeceğiz. Gözlerinizi izlemek için video görüntüsünü kullanın. Bir kalemi gözlerinizin önünde yüzünüze yatay olarak tutun. Sağ ve sol başparmak tırnaklarınızı sağ ve sol gözbebeklerinizin merkezleriyle hizalayın. Daha sonra başparmaklarınız arasındaki mesafeyi ölçmek için kalemi ekran cetveline getirin. Sol baş parmağınızı sıfıra hizalayın ve sağ baş parmağınızın nerede olduğuna dikkat edin. Kalemi bırakın ve bu noktada cetvele tıklayın. Son olarak devam etmek için Tamam'a tıklayın.",
