    sr: "1. ⇧🔊 МАКСИМАЛНИ ВОЛУМЕ. За тачну калибрацију звука, повећајте јачину звука на рачунару сада, пре калибрације, а затим не додирујте јачину звука док се сесија не заврши.\n2. НЕМА СЛУШАЛИЦА. Уклоните и искључите све слушалице/бублице. Ова калибрација неће радити са слушалицама/бубицама.",
    es: "1. ⇧🔊 VOLUMEN MÁXIMO. Para una calibración de sonido precisa, por favor maximice el volumen de sonido de su computadora ahora, antes de la calibración, y luego no toque el volumen hasta que termine la sesión. 2. SIN AURICULARES. Retire y desconecte cualquier auricular/audífono. Esta calibración no funcionará con auriculares/audífonos.",
    sw: "1. ⇧🔊 JUZUU MAX. Kwa urekebishaji sahihi wa sauti, tafadhali ongeza sauti ya kompyuta yako sasa, kabla ya kurekebisha, kisha usiguse sauti hadi kipindi kiishe.\n2. HAKUNA HEADPHONES. Ondoa na utenganishe vipokea sauti vya masikioni/vipokea sauti vya masikioni. Urekebishaji huu hautafanya kazi na vipokea sauti vya masikioni/vipokea sauti vya masikioni.",
    sv: "1. ⇧🔊 MAX VOLYM. För korrekt ljudkalibrering, maximera din dators ljudvolym nu, före kalibrering, och rör sedan inte vid volymen förrän sessionen är slut.\n2. INGA HÖRRTELEFON. Ta bort och koppla bort alla hörlurar/öronsnäckor. Denna kalibrering fungerar inte med hörlurar/öronsnäckor.",
