    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "VYBERTE SI, JAK KALIBROVAT REPRODUKTORY:\n1. JIŽ HOTOVO. Pokud jste reproduktory tohoto počítače již dříve kalibrovali, můžete mít možnost přeskočit rekalibraci opětovným použitím stávajícího kalibračního profilu. V opačném případě vyberte mikrofon, který chcete kalibrovat. Poznámka: Pravidla zabezpečení webové aplikace omezují rozpoznatelnost počítače, takže již zkalibrovaný počítač může zůstat nerozpoznaný. Pokud k tomu dojde, jednoduše překalibrujte. Příště se to snad pozná.\n2. SMARTPHONE. Použijte vestavěný mikrofon smartphonu.\n3. USB. Pokud vlastníte mikrofon miniDSP UMIK-1 nebo UMIK-2 (dostupný na Amazonu), vyberte „USB“ a připojte mikrofon k tomuto počítači.",
    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      "CHOOSE HOW TO CALIBRATE YOUR SPEAKERS:\n1. ALREADY DONE. If you’ve previously calibrated this computer’s loudspeakers, you may have the option of skipping recalibration by reusing your existing calibration profile. Otherwise, select a microphone to calibrate. Note: Web app security rules limit computer recognisability, so an already calibrated computer might go unrecognised. If this happens, simply recalibrate. It will probably be recognised next time.\n2. SMARTPHONE. Use your smartphone’s built-in microphone.\n3. USB. If you own a miniDSP UMIK-1 or UMIK-2 microphone (available on Amazon), select “USB” and connect your microphone to this computer.",
    fi: "Loading...",
    fr: "CHOISISSEZ COMMENT CALIBRER VOS ENCEINTES :\n1. DÉJÀ FAIT. Si vous avez déjà calibré les haut-parleurs de cet ordinateur, vous pouvez avoir l'option de sauter la recalibration en réutilisant votre profil de calibration existant. Sinon, sélectionnez un microphone pour calibrer. Remarque : Les règles de sécurité des applications Web limitent la reconnaissabilité de l'ordinateur, donc un ordinateur déjà calibré pourrait ne pas être reconnu. Si cela se produit, recalibrez simplement. Il sera probablement reconnu la prochaine fois.\n2. SMARTPHONE. Utilisez le microphone intégré de votre smartphone.\n3. USB. Si vous possédez un microphone miniDSP UMIK-1 ou UMIK-2 (disponible sur Amazon), sélectionnez « USB » et connectez votre microphone à cet ordinateur.",
