    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "EXPLICACIÓN. Para este paso, acérquese, si es necesario, para no estar a más del doble del ancho de la pantalla. Cada ojo tiene un punto ciego. Encontraremos el suyo para descubrir qué tan lejos está su ojo de la pantalla. Se le pedirá que cierre o cubra un ojo para aislar el otro. Mientras se enfoca en la cruz, observe el punto parpadeante con el rabillo del ojo y presione RETURN cuando desaparezca en su punto ciego. Dependiendo de la distancia de visualización y el tamaño de la pantalla, el punto parpadeante generalmente alcanzará su punto ciego antes de llegar al centro de la pantalla. Hará esto con cada ojo, alternando, hasta que las dos últimas mediciones sean consistentes. Por favor, mantenga su distancia de visualización mientras prueba ambos ojos. NOTA. Si el punto nunca desaparece, significa que su ojo está siguiendo el punto, en lugar de quedarse en la cruz. Esta prueba requiere que mantenga su ojo en la cruz mientras monitorea el punto parpadeante en el rabillo del ojo. Eso es difícil al principio, pero se vuelve más fácil con la práctica.",
