    "en-US":
      "On each trial, while you look at the cross, a triplet of three random digits will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. While looking at the cross, below, without moving your eyes: What is the middle digit?\n\n             +             7 1 3\n\nIt’s 1. This display is static, so it would be easy to move your eyes to the letter and identify it. But, in a real trial, the digits are FLASHED, so there's no time to move your eyes. Please look at the cross as you initiate the trial. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest. ",
    ar: "في كل تجربة، بينما تنظر إلى الصليب، ستظهر ثلاثية من ثلاثة أرقام عشوائية في زاوية عينك. مجرد وميض. لتعلم المهمة، دعونا نحاولها أولاً بعرض ثابت. أثناء النظر إلى الصليب، أدناه، دون تحريك عينيك: ما هو الرقم الأوسط؟\n\n             +             7 1 3\n\nإنه 1. هذا العرض ثابت، لذا سيكون من السهل تحريك عينيك إلى الحرف وتحديده. ولكن، في تجربة حقيقية، يتم وميض الأرقام، لذا لا يوجد وقت لتحريك عينيك. يرجى النظر إلى الصليب عند بدء التجربة. لا يهم أين تذهب عينيك بعد الوميض. الكتلة الأولى من الاختبار هي مجرد بضع تجارب تدريبية، قبل أن نبدأ بجدية.",
