    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, un chiffre aléatoire va CLIGNOTER dans le coin de votre œil. Juste un éclair. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger les yeux : Quel chiffre est-ce ?\n\n             +               3  \n\nC'est 3. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers le chiffre et de l'identifier. Mais, dans un essai réel, le chiffre CLIGNOTE, donc il n'y a pas de temps pour déplacer vos yeux. Veuillez regarder la croix lorsque vous commencez l'essai. Peu importe où vont vos yeux après le flash. Le premier bloc de test est juste quelques essais de pratique, avant que nous commencions sérieusement.",
    de: "Loading...",
    el: "Loading...",
    he: "בכל ניסוי, בזמן שאתה מסתכל על הצלב, ספרה אקראית תהבהב בזווית העין שלך. רק הבזק. כדי ללמוד את המשימה, בואו ננסה אותה תחילה עם תצוגה STATIC. תוך כדי הסתכלות על הצלב, למטה, בלי להזיז את העיניים: באיזו ספרה מדובר?\n\n             +               3  \n\nזה 3. התצוגה הזו סטטית, כך שיהיה קל להעביר את העיניים לספרה ולזהות אותה. אבל, בניסוי אמיתי, הספרה מהבהבת, אז אין זמן להזיז את העיניים. אנא הסתכל על הצלב כשאתה יוזם את המשפט. זה לא משנה לאן העיניים שלך הולכות אחרי ההבזק. הבלוק הראשון של הבדיקות הוא רק כמה ניסיונות של תרגול, לפני שנתחיל ברצינות.",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Pada setiap percobaan, saat Anda melihat salib, angka acak akan BERKEDIP di sudut mata Anda. Hanya sekejap. Untuk mempelajari tugasnya, mari kita coba dulu dengan tampilan STATIS. Sambil melihat salib di bawah, tanpa menggerakkan mata: Angka berapakah itu?\n\n             +               3  \n\nItu 3. Tampilan ini statis, jadi akan mudah untuk mengarahkan mata Anda ke angka tersebut dan mengidentifikasinya. Tapi, dalam uji coba sebenarnya, angkanya BERKEDIP, jadi tidak ada waktu untuk menggerakkan mata. Silakan lihat salib saat Anda memulai persidangan. Tidak masalah ke mana mata Anda tertuju setelah flash. Blok pengujian pertama hanyalah beberapa uji coba praktik, sebelum kita memulainya dengan sungguh-sungguh.",
    it: "In ogni prova, mentre guardi la croce, una cifra casuale LAMPEGGERÀ nell'angolo del tuo occhio. Solo un lampo. Per imparare il compito, proviamolo prima con un display STATICO. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Qual è la cifra?\n\n             +               3  \n\nÈ 3. Questo display è statico, quindi sarebbe facile muovere gli occhi verso la cifra e identificarla. Ma, in una prova reale, la cifra LAMPEGGIA, quindi non c'è tempo per muovere gli occhi. Per favore, guarda la croce mentre inizi la prova. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
    ja: "Loading...",
    kn: "ಪ್ರತಿ ಪ್ರಯೋಗದಲ್ಲಿ, ನೀವು ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ನಿಮ್ಮ ಕಣ್ಣಿನ ಮೂಲೆಯಲ್ಲಿ ಯಾದೃಚ್ಛಿಕ ಅಂಕೆಯು ಫ್ಲ್ಯಾಶ್ ಆಗುತ್ತದೆ. ಕೇವಲ ಒಂದು ಫ್ಲಾಶ್. ಕೆಲಸವನ್ನು ಕಲಿಯಲು, STATIC ಡಿಸ್ಪ್ಲೇಯೊಂದಿಗೆ ಅದನ್ನು ಮೊದಲು ಪ್ರಯತ್ನಿಸೋಣ. ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ಕೆಳಗೆ, ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಚಲಿಸದೆ: ಇದು ಯಾವ ಅಂಕೆ?\n\n             +              3  \n\nಇದು 3. ಈ ಪ್ರದರ್ಶನವು ಸ್ಥಿರವಾಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಅಂಕೆಗೆ ಸರಿಸಲು ಮತ್ತು ಅದನ್ನು ಗುರುತಿಸಲು ಸುಲಭವಾಗುತ್ತದೆ. ಆದರೆ, ನಿಜವಾದ ಪ್ರಯೋಗದಲ್ಲಿ, ಅಂಕೆಯು ಫ್ಲ್ಯಾಶ್ ಆಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಸರಿಸಲು ಸಮಯವಿಲ್ಲ. ನೀವು ವಿಚಾರಣೆಯನ್ನು ಪ್ರಾರಂಭಿಸುವಾಗ ದಯವಿಟ್ಟು ಶಿಲುಬೆಯನ್ನು ನೋಡಿ. ಫ್ಲ್ಯಾಷ್ ನಂತರ ನಿಮ್ಮ ಕಣ್ಣುಗಳು ಎಲ್ಲಿಗೆ ಹೋಗುತ್ತವೆ ಎಂಬುದು ಮುಖ್ಯವಲ್ಲ. ಪರೀಕ್ಷೆಯ ಮೊದಲ ಬ್ಲಾಕ್ ಅಭ್ಯಾಸದ ಕೆಲವು ಪ್ರಯೋಗಗಳು, ನಾವು ಶ್ರದ್ಧೆಯಿಂದ ಪ್ರಾರಂಭಿಸುವ ಮೊದಲು.",
    ko: "각 시도에서 십자가를 바라보는 동안 눈 구석에 임의의 숫자가 깜박일 것입니다. 그냥 플래시. 작업을 알아보기 위해 먼저 STATIC 디스플레이로 시도해 보겠습니다. 아래 십자가를 바라보며 눈을 움직이지 말고 몇 자리입니까?\n\n             +               3  \n\n3입니다. 이 디스플레이는 정적으로 표시되므로 숫자에 눈을 움직여 식별하기 쉽습니다. 하지만 실제 재판에서는 숫자가 깜박여서 눈을 움직일 시간이 없습니다. 재판을 시작할 때 십자가를 바라보십시오. 플래시 후에 눈이 어디로 가는지는 중요하지 않습니다. 테스트의 첫 번째 블록은 본격적으로 시작하기 전에 몇 가지 연습을 시도하는 것입니다.",
    lt: "Kiekvieno bandymo metu, kai žiūrite į kryžių, jūsų akies kamputyje mirksės atsitiktinis skaitmuo. Tiesiog blyksnis. Norėdami išmokti užduotį, pirmiausia išbandykite ją naudodami STATIC ekraną. Žiūrint į kryžių, apačioje, nepajudinant akių: koks tai skaitmuo?\n\n             +               3  \n\nTai yra 3. Šis ekranas yra statinis, todėl būtų lengva nukreipti akis į skaitmenį ir jį atpažinti. Tačiau tikrame bandyme skaitmuo mirksėja, todėl nėra laiko pajudinti akių. Pradėdami teismą, pažiūrėkite į kryžių. Nesvarbu, kur krypsta akys po blykstės. Pirmasis bandymų blokas yra tik keli praktikos bandymai, prieš pradedant rimtai.",
