      "SOUND DETECTION\n\nYou will complete several trials. In each trial, you may or may not hear a target sound: one note repeated 8 times. Half of the trials include the target sound, and half do not.\n\nYour task: After listening, press “y” if you heard the target sound, or “n” if you did not. The volume will adjust as you go, making the target barely detectable.\n\nIn the practice block, the target will be alone. Later, other sounds will play too—ignore them and focus only on detecting the target.\n\nHit RETURN or click PROCEED. ",
    ar: 'كشف الصوت\n\nستكمل عدة تجارب. في كل تجربة، قد تسمع أو لا تسمع صوت الهدف: نغمة واحدة تتكرر 8 مرات. نصف التجارب تتضمن صوت الهدف، والنصف الآخر لا يتضمنه.\n\nمهمتك: بعد الاستماع، اضغط "نعم" إذا سمعت صوت الهدف، أو "لا" إذا لم تسمعه. سيتم ضبط مستوى الصوت أثناء التجربة، مما يجعل الهدف بالكاد يمكن اكتشافه.\n\nفي كتلة التدريب، سيكون الهدف وحده. لاحقًا، ستُشغل أصوات أخرى أيضًا - تجاهلها وركز فقط على اكتشاف الهدف.\n\nاضغط على RETURN أو انقر على PROCEED.',
