    "en-UK":
      "SOUND DETECTION\n\nYou will complete several trials. In each trial, you may or may not hear a target sound: one note repeated 8 times. Half of the trials include the target sound, and half do not.\n\nYour task: After listening, press “y” if you heard the target sound, or “n” if you did not. The volume will adjust as you go, making the target barely detectable.\n\nIn the practice block, the target will be alone. Later, other sounds will play too—ignore them and focus only on detecting the target.\n\nHit RETURN or click PROCEED.",
    fi: "Loading...",
    fr: "DÉTECTION DU SON\n\nVous effectuerez plusieurs essais. Dans chaque essai, vous pouvez entendre ou non un son cible : une note répétée 8 fois. La moitié des essais incluent le son cible, et l'autre moitié non.\n\nVotre tâche : Après avoir écouté, appuyez sur \"y\" si vous avez entendu le son cible, ou sur \"n\" si vous ne l'avez pas entendu. Le volume s'ajustera au fur et à mesure, rendant le son cible à peine détectable.\n\nDans le bloc d'entraînement, le son cible sera seul. Plus tard, d'autres sons seront également joués—ignorez-les et concentrez-vous uniquement sur la détection du son cible.\n\nAppuyez sur RETOUR ou cliquez sur PROCÉDER.",
    de: "Loading...",
    el: "Loading...",
    he: 'זיהוי קול\n\nאתה תסיים מספר ניסויים. בכל ניסוי, אולי תשמע או לא תשמע צליל מטרה: צליל אחד שחוזר על עצמו 8 פעמים. מחצית מהניסויים כוללים את צליל המטרה, וחצי לא.\n\nהמשימה שלך: לאחר האזנה, הקש "y" אם שמעתם את צליל היעד, או "n" אם לא שמעתם. עוצמת הקול יתכוונן תוך כדי כך שהמטרה כמעט ואינה ניתנת לזיהוי.\n\nבבלוק התרגול, המטרה תהיה לבד. מאוחר יותר, גם צלילים אחרים יתנגנו - התעלם מהם והתמקד רק בזיהוי המטרה.\n\nלחץ על חזור או לחץ על המשך. ',
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "DETEKSI SUARA\n\nAnda akan menyelesaikan beberapa uji coba. Dalam setiap percobaan, Anda mungkin mendengar suara target atau tidak: satu nada diulang sebanyak 8 kali. Setengah dari uji coba menyertakan suara target, dan setengahnya lagi tidak.\n\nTugas Anda: Setelah mendengarkan, tekan “y” jika Anda mendengar suara target, atau “n” jika tidak. Volumenya akan menyesuaikan seiring berjalannya waktu, membuat target hampir tidak dapat terdeteksi.\n\nDi blok latihan, targetnya akan sendirian. Nanti, suara lain juga akan diputar—abaikan saja dan fokus hanya untuk mendeteksi target.\n\nTekan KEMBALI atau klik LANJUTKAN. ",
    it: 'RILEVAMENTO DEL SUONO\n\nCompleterai diverse prove. In ogni prova, potresti sentire o meno un suono bersaglio: una nota ripetuta 8 volte. La metà delle prove include il suono bersaglio, l\'altra metà no.\n\nIl tuo compito: dopo aver ascoltato, premi "y" se hai sentito il suono bersaglio, o "n" se non l\'hai sentito. Il volume si regolerà man mano, rendendo il bersaglio appena rilevabile.\n\nNel blocco di pratica, il bersaglio sarà da solo. Successivamente, verranno riprodotti anche altri suoni: ignorali e concentrati solo sul rilevamento del bersaglio.\n\nPremi INVIO o fai clic su PROSEGUI.',
    ja: "Loading...",
    kn: 'ಸೌಂಡ್ ಡಿಟೆಕ್ಷನ್\n\nನೀವು ಹಲವಾರು ಪ್ರಯೋಗಗಳನ್ನು ಪೂರ್ಣಗೊಳಿಸುತ್ತೀರಿ. ಪ್ರತಿ ಪ್ರಯೋಗದಲ್ಲಿ, ನೀವು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಕೇಳಬಹುದು ಅಥವಾ ಕೇಳದೇ ಇರಬಹುದು: ಒಂದು ಟಿಪ್ಪಣಿಯನ್ನು 8 ಬಾರಿ ಪುನರಾವರ್ತಿಸಲಾಗುತ್ತದೆ. ಅರ್ಧದಷ್ಟು ಪ್ರಯೋಗಗಳು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಒಳಗೊಂಡಿರುತ್ತವೆ ಮತ್ತು ಅರ್ಧದಷ್ಟು ಇಲ್ಲ.\n\nನಿಮ್ಮ ಕಾರ್ಯ: ಆಲಿಸಿದ ನಂತರ, ನೀವು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಕೇಳಿದರೆ "y" ಅಥವಾ ನೀವು ಕೇಳದಿದ್ದರೆ "n" ಒತ್ತಿರಿ. ನೀವು ಹೋದಂತೆ ವಾಲ್ಯೂಮ್ ಸರಿಹೊಂದಿಸುತ್ತದೆ, ಗುರಿಯನ್ನು ಕಂಡುಹಿಡಿಯಲಾಗದಂತೆ ಮಾಡುತ್ತದೆ.\n\nಅಭ್ಯಾಸ ಬ್ಲಾಕ್‌ನಲ್ಲಿ, ಗುರಿ ಏಕಾಂಗಿಯಾಗಿರುತ್ತಾನೆ. ನಂತರ, ಇತರ ಶಬ್ದಗಳು ಸಹ ಪ್ಲೇ ಆಗುತ್ತವೆ-ಅವುಗಳನ್ನು ನಿರ್ಲಕ್ಷಿಸಿ ಮತ್ತು ಗುರಿಯನ್ನು ಪತ್ತೆಹಚ್ಚುವಲ್ಲಿ ಮಾತ್ರ ಕೇಂದ್ರೀಕರಿಸುತ್ತವೆ.\n\nಹಿಂತಿರುಗಿ ಒತ್ತಿರಿ ಅಥವಾ ಮುಂದುವರೆಯಿರಿ ಕ್ಲಿಕ್ ಮಾಡಿ. ',
    ko: '소리 감지\n\n여러 가지 시험을 완료하게 됩니다. 각 시험에서 목표 소리가 들리거나 들리지 않을 수 있습니다. 하나의 음표가 8번 반복됩니다. 시도의 절반은 목표 사운드를 포함하고 나머지 절반은 포함하지 않습니다.\n\n과제: 들은 후 대상 소리가 들리면 "y"를 누르고, 들리지 않으면 "n"을 누르세요. 이동하면서 볼륨이 조정되어 표적을 거의 감지할 수 없게 됩니다.\n\n연습 블록에서는 대상이 혼자가 됩니다. 나중에 다른 소리도 재생됩니다. 무시하고 대상 감지에만 집중하세요.\n\nRETURN을 누르거나 PROCEED를 클릭하세요. ',
    lt: "Loading...",
    ms: 'PENGESAN BUNYI\n\nAnda akan menyelesaikan beberapa percubaan. Dalam setiap percubaan, anda mungkin atau mungkin tidak mendengar bunyi sasaran: satu nota diulang 8 kali. Separuh daripada percubaan termasuk bunyi sasaran, dan separuh tidak.\n\nTugas anda: Selepas mendengar, tekan "y" jika anda mendengar bunyi sasaran, atau "n" jika anda tidak mendengarnya. Kelantangan akan melaraskan semasa anda pergi, menjadikan sasaran hampir tidak dapat dikesan.\n\nDi blok latihan, sasaran akan bersendirian. Kemudian, bunyi lain akan dimainkan juga—abaikan bunyi tersebut dan fokus hanya pada pengesanan sasaran.\n\nTekan RETURN atau klik PROCEED. ',
